  match tokenIdx with
  | 0 -> TOKEN_NUMBER 
  | 1 -> TOKEN_EOF 
  | 2 -> TOKEN_SEMICOLON 
  | 3 -> TOKEN_MINUS 
  | 4 -> TOKEN_PLUS 
  | 7 -> TOKEN_end_of_input
  | 5 -> TOKEN_error
  | _ -> failwith "tokenTagToTokenId: bad token"

